import React from 'react';


function Navbar() {
  return (
    <nav className="navbar">
      <ul>
        <li><a href="#">Home</a></li>
        <li><a href="#">Report Lost Item</a></li>
        <li><a href="#">Report Found Item</a></li>
        <li><a href="#">View Items</a></li>
      </ul>
    </nav>
  );
}

export default Navbar;
